import React, { Component } from 'react';
import LineChart from '../LineChart/LineChart';
import './rooms.css';

export default class Rooms extends Component {
  render() {
    return (
      <div>
        <div id='rooms'>
                <div className='room'>
                  Kitchen
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                  <button>Set Temperature</button>
                  <LineChart 
                    width={600} 
                    height={400}
                    title={'Current Temperature'}
                  />
                </div>

                <div className='room'>
                  Bedroom
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                </div>
                <div className='room'>
                  Living Room
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                </div>
                <div className='room'>
                  Bathroom
                  <h5>Temperature: 26C</h5>
                  <h6>Status:cooling</h6>
                </div>
        </div>
      </div>
    )
  }
}
